import React from "react";

interface IProps {
  url: string;
}

const AudioMessage: React.FC<IProps> = ({ url }) => {
  return (
    <audio controls>
      <source src="horse.mp3" type="audio/mpeg" />
    </audio>
  );
};

export default AudioMessage;
